public void testLongEncode() {
  for(int i=0;i<10000;i++) {
    long v = random().nextLong();
    byte[] tmp = new byte[8];
    BKDUtil.longToBytes(v, tmp, 0);
    long v2 = BKDUtil.bytesToLong(tmp, 0);
    assertEquals("got bytes=" + Arrays.toString(tmp), v, v2);
  }
}

